import React, { FC} from 'react';
import { Colors } from '../../models/colors';

interface Props {
    currentColor: Colors | null;
}

const Info: FC<Props> = ({currentColor}) => {
    if (!currentColor) {
        return null;
    }

    return (
        <h3>
            {currentColor} King is under attack
        </h3>
    )
}

export default Info;
